import React from "react";
import '../css/Skill.css'

const Skills = () => {
    let initSkills=[{image:"",title:"javascript"},{image:"",title:"Python"},{image:"",title:"sql"}]
    return(

        <div >
            <div className="Skill_box">
            {initSkills.map((Element)=>(
                <p key={Element.title}> name :{Element.title}</p>
            ))}
            {initSkills.map((Element) => (
                <p key={Element.title}>name: {Element.title}</p>
            ))}


            </div>

        </div>
    );
}
export default Skills;
